  \"Cultural Resource Survey of Proposed Ditch Plugs Near Troublesome Creek in Marion
  County, Missouri\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:41:24.514709\",\n\t\"name\": \"cultural-resource-survey-of-proposed-ditch-plugs-near-troublesome-creek-in-marion-county-m\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A phase I cultural resource survey was
  conducted for the US Department of the Interior, Fish and Wildlife Service, of three
  proposed ditch plugs to be constructed across intermittent streams that represent
  abandoned channel scars of Troublesome Creek. The areas of the proposed plugs, the
  proposed borrow locations, an access road to this locations, and areas between the
  plugs were surveyed. Investigations resulted in the identification of three previous
  undefined sites. Site 23MA169 possibly was a large settlement occupied on at least
  a seasonal basis. It is situated on a terrace within a U-shaped bend of Troublesome
  Creek. Construction activity is away from and will pass through the western edge
  of site 23MA170. Field investigations revealed that B-horizon subsoils outcrops
  on the surface of this area as a result of years of agricultural use and erosion.
  It is determined that there is little possibility of intact subsurface data at this
  site and it is concluded that the site does not possess the potential for significance.
  No further work is recommended at this location.\",\n\t\"license_title\": \"License
